import Login from "./components/Login";
import Pic from "./components/pic";

function App() {
  return (
    <div className="flex flex-row-reverse ">
      <div className="bg-[#0f172a]">
        <img src="bios.png" alt="bios" class="h-24 m-16"></img>
        <Login />
      </div>
      <div>
        <Pic />
      </div>
    </div>
  );
}

export default App;
